import React from "react";
import Navbar from "../../Components/Navbar/Navbar";

const Home = () => {
  const renderComponent = () => {
    return (
      <>
        <Navbar />
        <form >
        <input
          type="text"
          placeholder="Search"
          value={searchValue}
          onChange={handleSearchChange}
        />
        <button type="submit">Search</button>
      </form>
      </>
    );
  };
  return renderComponent();
};

export default Home;
